import{_ as t,c as e,o as r,a3 as a}from"./chunks/framework.zGi9i9Bf.js";const b=JSON.parse('{"title":"3.Rust 进阶篇","description":"","frontmatter":{},"headers":[],"relativePath":"Document/Rust/3.Rust进阶篇.md","filePath":"Document/Rust/3.Rust进阶篇.md","lastUpdated":1713983661000}'),s={name:"Document/Rust/3.Rust进阶篇.md"},o=a('<h1 id="_3-rust-进阶篇" tabindex="-1">3.Rust 进阶篇 <a class="header-anchor" href="#_3-rust-进阶篇" aria-label="Permalink to &quot;3.Rust 进阶篇&quot;">​</a></h1><p><a href="https://mp.weixin.qq.com/s/38jxk2OR5jmIfpvsoNPr_g" target="_blank" rel="noreferrer">拥抱未来语言Rust|进阶篇开篇词，浅浅期待一下23种设计模式的Rust版本，咱们不见不散 (qq.com)</a></p><p><a href="https://mp.weixin.qq.com/s/tSSMruvZUACwluD9yCm8PA" target="_blank" rel="noreferrer">格局炸裂，一定要收藏的23种设计模式(rust实现附代码)，进阶完结汇总！ (qq.com)</a></p><p><a href="https://mp.weixin.qq.com/s/hQf0I8DWuIrX51mTMRvNXQ" target="_blank" rel="noreferrer">【Rust日报】如何编写一个既是 bin 又是 lib 的项目 (qq.com)</a></p><p><a href="https://mp.weixin.qq.com/s/VT72wi8Lfi_8ODYN5VN0GA" target="_blank" rel="noreferrer">Rust 语言打造的安全 DNS 解决方案：Hickory DNS (qq.com)</a></p><p><a href="https://blog.csdn.net/weixin_47754149/category_11950496.html" target="_blank" rel="noreferrer">Rust 进阶篇_广龙宇的博客-CSDN 博客</a></p><p><a href="https://mp.weixin.qq.com/s/xPOnxOig2fGG-7BT0SB5CA" target="_blank" rel="noreferrer">深入理解 Rust 模块系统 (qq.com)</a></p><p><a href="https://mp.weixin.qq.com/s/vxqFOnxqLnUmNAhUAgX3_g" target="_blank" rel="noreferrer">Rust 掌握模式匹配和错误处理玩转高效编程 (qq.com)</a></p><p><a href="https://mp.weixin.qq.com/s/rqpFyf7-Cx6Ota7e9zbOOg" target="_blank" rel="noreferrer">逼自己看完，你的Rust撸码水平就会提高，手搓一个mini-async异步运行时——Rust高并发的基础 (qq.com)</a></p><p><a href="https://mp.weixin.qq.com/s/XRNJqbBmtdX9jgBePSyKJg" target="_blank" rel="noreferrer">Rust 并发编程秘籍：手把手教你用原子操作和锁编写高性能代码 (qq.com)</a></p><h2 id="适合rust初学者晋级到中级的项目" tabindex="-1">适合Rust初学者晋级到中级的项目 <a class="header-anchor" href="#适合rust初学者晋级到中级的项目" aria-label="Permalink to &quot;适合Rust初学者晋级到中级的项目&quot;">​</a></h2><h3 id="项目1-pong游戏" tabindex="-1">项目1：Pong游戏 <a class="header-anchor" href="#项目1-pong游戏" aria-label="Permalink to &quot;项目1：Pong游戏&quot;">​</a></h3><p>这个项目使用piston游戏引擎和OpenGL图形库构建Pong游戏，这个游戏创建两个球拍，一个在左边，一个在右边，还有一个球。有2名玩家，他们将能够用Y和X键和上下箭头处理左右球拍。</p><p>github地址：<a href="https://github.com/EleftheriaBatsou/pong-game-rust" target="_blank" rel="noreferrer">https://github.com/EleftheriaBatsou/pong-game-rust</a></p><h3 id="项目2-聊天应用程序" tabindex="-1">项目2：聊天应用程序 <a class="header-anchor" href="#项目2-聊天应用程序" aria-label="Permalink to &quot;项目2：聊天应用程序&quot;">​</a></h3><p>聊天应用程序是常见的，许多应用程序都在使用。这个应用程序由两部分组成：客户端和服务器。可以在客户端输入一些内容，服务器将接收它。</p><p>github地址：<a href="https://github.com/EleftheriaBatsou/chat-app-client-server-rust/" target="_blank" rel="noreferrer">https://github.com/EleftheriaBatsou/chat-app-client-server-rust/</a></p><h3 id="项目3-贪吃蛇游戏" tabindex="-1">项目3：贪吃蛇游戏 <a class="header-anchor" href="#项目3-贪吃蛇游戏" aria-label="Permalink to &quot;项目3：贪吃蛇游戏&quot;">​</a></h3><p>这个项目向大家展示如何用Rust编写“Snake游戏”！我觉得Snake是展示你技能的最佳项目。</p><p>github地址：<a href="https://github.com/EleftheriaBatsou/snake-game-rust" target="_blank" rel="noreferrer">https://github.com/EleftheriaBatsou/snake-game-rust</a></p><h3 id="项目4-端口扫描器" tabindex="-1">项目4：端口扫描器 <a class="header-anchor" href="#项目4-端口扫描器" aria-label="Permalink to &quot;项目4：端口扫描器&quot;">​</a></h3><p>这个项目创建一个IP嗅探器/端口嗅探器！你将学习如何构建一个基本的网络工具，该工具可以扫描指定IP地址上的端口，以查看哪些端口是打开的。</p><p>该项目使用异步任务(tokio)扫描指定IP地址上的一系列端口，利用TcpStream进行端口连接检查。它提供了一种结构化的方式来处理命令行参数(bpaf)，并演示了Rust异步编程模型在网络应用程序中的强大功能。</p><p>这是一个实用的项目，可以帮助你理解网络编程、使用Tokio的异步Rust以及使用Bpaf处理命令行参数。这将对网络操作和Rust强大的异步特性有更清晰的了解。</p><p>github地址：<a href="https://github.com/EleftheriaBatsou/port-sniffer-cli-rust" target="_blank" rel="noreferrer">https://github.com/EleftheriaBatsou/port-sniffer-cli-rust</a></p><h3 id="项目5-视频下载客户端" tabindex="-1">项目5：视频下载客户端 <a class="header-anchor" href="#项目5-视频下载客户端" aria-label="Permalink to &quot;项目5：视频下载客户端&quot;">​</a></h3><p>这个项目创建了一个CLI视频下载程序，并涵盖解析命令行参数、发出HTTP请求和处理错误等内容。到最后，你将对Rust的强大功能以及如何在实际场景中应用它们有更深入的了解。</p><p>该项目使用HTTP请求与API进行通信，以获取视频/音频流url，使用requestwest下载流，并将它们保存到指定的路径。它使用命令行参数进行用户配置，并使用clap解析这些参数。</p><p>用Rust构建CLI视频下载器对于想要应用Rust技能的初学者来说是一个非常棒的项目。</p><p>github地址：<a href="https://github.com/EleftheriaBatsou/cli-yt-downloader-rust" target="_blank" rel="noreferrer">https://github.com/EleftheriaBatsou/cli-yt-downloader-rust</a></p><h3 id="用rust从头实现一个c编译器" tabindex="-1">用Rust从头实现一个C编译器 <a class="header-anchor" href="#用rust从头实现一个c编译器" aria-label="Permalink to &quot;用Rust从头实现一个C编译器&quot;">​</a></h3><p>一个针对 MacOs 和 Linux 的 x86-64 的 C99 编译器，它没有任何依赖项，并且是独立的，因此可以通过单个命令进行安装（请参阅安装）。</p><p>更多信息查看 GitHub：<a href="https://github.com/PhilippRados/wrecc" target="_blank" rel="noreferrer">https://github.com/PhilippRados/wrecc</a></p>',33),h=[o];function i(p,n,u,l,c,m){return r(),e("div",null,h)}const _=t(s,[["render",i]]);export{b as __pageData,_ as default};
